import React, { useState, useRef, useEffect } from "react";
import { Link, useNavigate } from "react-router-dom";
import "./Header.css";

const Header = () => {
  const [isOpen, setIsOpen] = useState(false);
  const [user, setUser] = useState(null); // null = niezalogowany, obiekt = zalogowany
  const navRef = useRef(null);
  const hamburgerRef = useRef(null);
  const navigate = useNavigate();

  // ZamkniÄ™cie menu po klikniÄ™ciu poza nim
  useEffect(() => {
    const handleClickOutside = (event) => {
      if (
        isOpen &&
        navRef.current &&
        !navRef.current.contains(event.target) &&
        hamburgerRef.current &&
        !hamburgerRef.current.contains(event.target)
      ) {
        setIsOpen(false);
      }
    };
    document.addEventListener("mousedown", handleClickOutside);
    return () => document.removeEventListener("mousedown", handleClickOutside);
  }, [isOpen]);

  const handleLogin = () => {
    navigate("/volunteer-login");
  };

  const handleLogout = () => {
    setUser(null);
    navigate("/"); // po wylogowaniu przenosi na stronÄ™ gÅ‚Ã³wnÄ…
  };

  return (
    <header className="header">
      <div className="header-container">
        <Link to="/" className="logo">
          <img src="/img/logo.png" alt="Adoptuj Przyjaciela" />
        </Link>

        {/* Menu i przyciski desktop */}
        <nav ref={navRef} className={`nav ${isOpen ? "open" : ""}`}>
          <Link to="/zwierzaki-do-adopcji">Zwierzaki do adopcji</Link>
          <Link to="/czas-ze-zwierzakiem">Czas ze zwierzakiem</Link>
          <Link to="/help">Jak pomÃ³c?</Link>
          <Link to="/wolontariat">Wolontariat</Link>
          <Link to="/blog">Blog</Link>
          <Link to="/o-nas">O nas</Link>
          <Link to="/kontakt">Kontakt</Link>
        </nav>

        <div className="desktop-login">
          {user ? (
            <div className="user-info">
              <span className="user-icon">ðŸ‘¤</span>
              <button className="login-btn" onClick={handleLogout}>
                Wyloguj
              </button>
            </div>
          ) : (
            <button className="login-btn" onClick={handleLogin}>
              Zaloguj
            </button>
          )}
        </div>

        {/* Hamburger */}
        <div
          ref={hamburgerRef}
          className="hamburger"
          onClick={() => setIsOpen(!isOpen)}
        >
          <div></div>
          <div></div>
          <div></div>
        </div>

        {/* Przyciski mobile */}
        <div className="mobile-login">
          {user ? (
            <div className="user-info">
              <span className="user-icon">ðŸ‘¤</span>
              <button className="login-btn" onClick={handleLogout}>
                â¬…
              </button>
            </div>
          ) : (
            <button className="login-btn" onClick={handleLogin}>
              ðŸ”‘
            </button>
          )}
        </div>

        {isOpen && <div className="nav-overlay" onClick={() => setIsOpen(false)} />}
      </div>
    </header>
  );
};

export default Header;
